    color: #fff;
    -webkit-border-radius: 5px 0 5px 5px;
    -moz-border-radius: 5px 0 5px 5px;
    -ms-border-radius: 5px 0 5px 5px;
    border-radius: 5px 0 5px 5px;
    background: #2f4053;

    display: inline-block;
    max-width: 80%;
    padding: 8px 13px;
    box-shadow: none;
    border: none;
    position: relative;
    text-align: left;
    font-size: 15px;
    word-wrap: break-word;
}

